/**
 * @internal
 */
exports.AndConjunction = {
    keys: ['and', '&&'],
    rule: function (expressionResults) { return expressionResults[0] && expressionResults[1]; }
};
/**
 * @internal
 */
exports.OrConjunction = {
    keys: ['or', '||'],
    rule: function (expressionResults) { return expressionResults[0] || expressionResults[1]; }
};
exports.CORE_CONJUNCTIONS = [
    exports.AndConjunction,
    exports.OrConjunction
];
